import React from 'react';
import CardList from './CardList';
import {nbaPlayers} from './nbaPlayers';

const App = () => {

   return (
      <div>
      <h1>NBA Dash Board</h1>
      <CardList nbaPlayers = {nbaPlayers}/>
      </div>
   )
}

export default App;
